

#include <bits/stdc++.h>

#include <utility>

using namespace std;

struct TreeNode {
    TreeNode *left, *right;
    int val;

    TreeNode() : left(nullptr), right(nullptr), val(0) {};

    TreeNode(int x) : left(nullptr), right(nullptr), val(x) {};
};

class Solution {
public:
    vector<int> countSmaller(vector<int> &nums) {
        vector<int> newNums = {nums[nums.size() - 1]};
        vector<int> ans;
        ans.emplace_back(0);
        for (int i = nums.size() - 2; i >= 0; --i) {
            int l = 0, r = newNums.size() - 1;
            while (l < r) {
                int mid = l + ((r - l) >> 1);
                if (newNums[mid] < nums[i]) {
                    l = mid + 1;
                } else {
                    r = mid;
                }
            }
            ans.emplace_back(l);
            newNums.insert(newNums.begin() + l, nums[i]);
        }
        std::reverse(ans.begin(), ans.end());
        return ans;
    }
};

